import React, { useState } from 'react';
import { Icon } from "@iconify/react";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Modal, Box, Typography, TextField } from '@mui/material';
import ModalForm from './ModalForm';
import { updateVoterAction } from '../redux/actions/action';
import { useDispatch } from 'react-redux';

const VoterTable = ({ voters, handleSuccessToast }) => {
  const dispatch = useDispatch();
  const [selectedVoter, setSelectedVoter] = useState(null);
  const [open, setOpen] = useState(false);
  const [formData, setFormData] = useState({
    voter_name: '',
    age: '',
    sex: '',
    state: '',
    constituency: '',
    party: '',
    casted: false,
    figured_by: ''
  });

  const handleOpen = (voter) => {
    setSelectedVoter(voter);
    setFormData({ ...voter });
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = () => {
    const figuredBy = localStorage.getItem('name');
    const { voter_name, age, sex, state,constituency, party, casted, figured_by } = formData;
    const updatedFields = { voter_name, age, sex, state,constituency , party, casted, figured_by: figuredBy };
    console.log(updatedFields);

    dispatch(updateVoterAction(selectedVoter.id, { voter: updatedFields }));
    setOpen(false);

    // Call the success toast function passed from VolunteerData
    handleSuccessToast();
  };

  return (
    <>
      <TableContainer component={Paper} sx={{ boxShadow: '0px 0px 5px #888888', borderRadius: '15px', marginTop: '20px' }}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead sx={{ backgroundColor: '#EE8832', }}>
            <TableRow>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>ID</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Name</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Age</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Sex</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>State</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Party</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Casted</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Figured By</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: 'white' }}>Action</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {voters.map((voter) => (
              <TableRow key={voter.id} sx={{ '&:nth-child(even)': { backgroundColor: '#fef2ea' } }}>
                <TableCell>{voter.id}</TableCell>
                <TableCell>{voter.voter_name}</TableCell>
                <TableCell>{voter.age}</TableCell>
                <TableCell>{voter.sex}</TableCell>
                <TableCell>{voter.state}</TableCell>
                <TableCell>{voter.party}</TableCell>
                <TableCell>{voter.casted ? "Yes" : "No"}</TableCell>
                <TableCell>{voter.figured_by}</TableCell>
                <TableCell>
                  <Button variant="contained" color="primary" onClick={() => handleOpen(voter)}>Edit</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <ModalForm
          handleClose={handleClose}
          handleChange={handleChange}
          handleSubmit={handleSubmit}
          formData={formData}
        />
      </Modal>
    </>
  );
};

export default VoterTable;
